import React from 'react';



function Contact () {
    return (
        <section>
            <h2>Contact Info</h2>
            <ul>
                <li>
                    Email: Bebetter@whatever.com
                </li>
                <li>
                    Phone: 801-000-000
                </li>
            </ul>
        </section>
    )
}
export default Contact;
